long_desc.thetext:
Created attachment 1227
patch for the demobrowser backend for reproduction

Description:
  Whith a backend that alters the "rowNum" (e.g. depending on filters) the
  "getRowData" RPC-call is not triggered.

To Reproduce:
  Unfortunately it is not possible to create a playground example without having
  a backend that alters the rowNum at hand. Therfore a "patch" for the demobrowser
  is attached, to reproduce this.
  In general, this is how to reproduce the issue:
  * have a backend, that alternatively returns 1000 or 500 as rowNum.
  * have a frontend that is able to call qx.ui.table.model.Remote::reloadData

Additional Information:
  The whole issue is discussed in the Mailing-List[1].
  The additional attached images show the network traffic for three consecutive
  "reloadData" calls.

  What can be observed is, that one can 'fix' the "1.2.1 branch" version by
  using this:
  <code>
        if (this._firstLoadingBlock != -1) {
          // ...
        }
        // Force clearing row cache, because of reloading data.
        this._clearCache = true;
        // ...
  </code>

  instead of (the current)

  <code>
        if (this._firstLoadingBlock != -1) {
          // ...
          // Force clearing row cache, because of reloading data.
          this._clearCache = true;
        }
        // ...
  </code>
  in qx.ui.table.model.Remote#reloadData().


[1] http://qooxdoo.10916.n7.nabble.com/qx-ui-table-model-Remote-reloadData-issue-in-1-2-x-branch-td44202.html

I'd like to point out that its not only Peter Schneider who was hit by this bug ...

After upgrading from 1.4.1 to 2.1.1 reloadData() stopped reloading data and displaying the updated table also in my application. The suggested workaround cured this problem in my case, too. I decided to overload reloadData() and set _clearCache before launching the super classes reloadData():

qx.Class.define("myapp.table.SearchResults",
{
  extend : qx.ui.table.model.Remote,
[...]
    reloadData : function() {
	this._clearCache = true; // needed for 2.1.1 compatibility
	this.base( arguments );
    }
[...]

Thank you Peter, this saved me a lot of time.
